-- ----------------------------
-- Table structure for cars
-- ----------------------------
DROP TABLE IF EXISTS `cars`;
CREATE TABLE `cars` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `brand_id` int(11) unsigned NOT NULL,
  `series_id` int(11) unsigned NOT NULL,
  `series_name` varchar(255) DEFAULT NULL,
  `name` varchar(255) DEFAULT NULL,
  `alias_name` varchar(255) DEFAULT NULL,
  `engine_model` varchar(100) DEFAULT NULL,
  `engine_type` varchar(100) DEFAULT NULL,
  `engine_displacement` varchar(100) DEFAULT NULL,
  `engine_description` varchar(100) DEFAULT NULL,
  `engine_maxpower` varchar(100) DEFAULT NULL,
  `engine_cylinder` int(5) DEFAULT NULL,
  `engine_torsion` varchar(100) DEFAULT NULL,
  `year` varchar(4) DEFAULT NULL,
  `type` varchar(50) DEFAULT NULL,
  `shelf_life` varchar(50) DEFAULT NULL,
  `status` tinyint(2) unsigned NOT NULL DEFAULT '0',
  `wheelbase` varchar(50) DEFAULT NULL COMMENT '轴距',
  `drive_type` varchar(50) DEFAULT NULL COMMENT '驱动类型',
  `is_atom` tinyint(4) NOT NULL DEFAULT '0' COMMENT '是否原子车型',
  `year_area` varchar(50) NOT NULL DEFAULT '' COMMENT '原子车款年款区间',
  `platform` varchar(50) NOT NULL DEFAULT '' COMMENT '原子车款车身平台代号',
  `pic` varchar(100) NOT NULL DEFAULT '' COMMENT '新增车款缩略图',
  PRIMARY KEY (`id`),
  KEY `year` (`year`)
) ENGINE=InnoDB AUTO_INCREMENT=38723 DEFAULT CHARSET=utf8;

